import io from 'socket.io-client';

export function create_socket_server( params ) {

    const socket = io(params.room_address);
    console.log(params);
    let msg = {
        from: {
            name: params.nick_name,
            color : ''
        },
        msg: "in"
    };

    this.socket.emit('chat', msg);
    
}
